// Nav.js
import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <div className="nav-bar">
      <img className="logo" src="%PUBLIC_URL%/vivian-source/logo.jpg" alt="Logo" />
      <Link to="/">Xem Phòng</Link>
      <Link to="/discover">Khám Phá</Link>
      <Link to="/contact">Liên Lạc</Link>
      <Link to="/book-room" className="book-link">Đặt Phòng</Link>
    </div>
  );
};

export default Nav;
